INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(1, , 'Admin', '2019-09-29', 'Tech', 'With the technology landscape shifting very rapidly, one of the key questions concerning global organizations today is how to develop and sustain a competitive advantage with IT infrastructure transformation.\r\n\r\nIT infrastructure transformation enables organizations to respond effectively to the volatile and fluctuating business environments, focus on business innovation and deliver value-added services for an enhanced end-user experience.\r\n\r\nInfrastructure Modernization\r\nA core component of digital transformation is the deployment of modernized technology. The rapid advances in cloud computing and other emerging technologies such as virtualization and Software-Defined Networking (SDN) are enabling organizations in creating an agile and flexible infrastructure.\r\n\r\nPresently, around 80% of the IT budget is spent by companies for maintaining the existing IT infrastructure, leaving a limited amount for building and deploying a new infrastructure for supporting new workloads and reducing operational costs.\r\n\r\nHence, it becomes essential to explore newer ways of consolidating, standardizing and rationalizing the existing infrastructure. This transformation of the IT infrastructure not only ensures a more efficient performance, but also enables organizations to sustain a competitive edge.\r\n\r\nDigital Transformation Concept\r\nDigital transformation is built on third-platform technologies such as cloud, analytics, mobile and social, and optimizes the method of engagement of companies with their workforce, customers and business networks.\r\n\r\nDigital transformation is accelerated by converged infrastructure, which ensures that systems are managed and supported as a single entity and creates an agile environment that enables faster innovation and continued growth. A digital transformation framework includes elements such as operational agility, leadership, customer experience and digital technology integration, among others.\r\n\r\nThe success of digital business transformation is dependent on a corresponding IT infrastructure transformation.\r\n\r\nThe Impact of Cloud Technologies\r\nCloud computing facilitates the adoption of new business models and maximizes the efficiency of shared resources, in addition to managing IT infrastructure costs. An increasing number of companies are making use of the dynamic cloud services for business transformation and improved user experience.\r\n\r\nOn similar lines, SDN contributes to accelerating the development, improving business productivity and simplifying compliance. Virtualization technology helps organizations in simplifying IT operations, reducing costs and responding quickly to the constantly changing business demands.\r\n\r\nBy adopting an integrated framework of cloud-based communications, SDN and virtualization, enterprises can achieve an agile, reliable and flexible IT infrastructure.\r\n\r\nElements of Digital Transformation\r\nDigital transformation entails the transformation of business models, operational processes and customer experience. Digital technology enables companies to expand their focus globally despite a local presence.\r\n\r\nOrganizations are exploring newer ways to incorporate digital offerings, in addition to their physical products and use the digital medium for sharing information in order to drive business growth. Transformation of the internal processes using process digitization and performance management has also led to several benefits.\r\n\r\nIT Infrastructure Optimization\r\nAccording to IDC, the pace of digital transformation is defined by how IT infrastructure development, maintenance and support are optimized. For optimizing IT operations, automation is an essential component. Automation ensures the effective management of multiple network devices and servers.\r\n\r\nOptimization done through automation not only helps in lowering risk and improving agility, but also contributes to enhanced cost savings and human-error reduction.\r\n\r\nHowever, as developing IT service automation platforms in-house is not economical, companies generally utilize the services of the vendors owning the platforms in realizing faster IT service operations.\r\n\r\nIn Conclusion\r\nOrganizations can look at new avenues for business growth and expansion with a strategic transformation achieved by harnessing digital technologies. Optimization of the operational processes and IT infrastructure through automation is the key to achieve the desired end-result.', 0, 0, 'Business,Career,Innovation', 'Digital Transformation With IT Infrastructure Services\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(2, , 'Admin ', '2019-09-29', 'Tech', 'All think to be an Ideapreneur, make an Entrepreneurial journey and develop a business to serve the globe. Do we really posses such skill set, quality, ability to perform and most important reliability. Yes Quality and Reliability play a crucial role in your business development.\r\n\r\nYou know very well about Dhirubhai Ambani who built his empire based on these principle of reliance and quality commitment.\r\n\r\nWhen you go to purchase a product then first thing comes in your mind is Brand which is always outcome of reliance, faith, trust and quality of the product. These are leading factor for your business growth.\r\n\r\nAlways built your brand product based on reliance and quality. Be a Leader and grow fast.', 0, 0, 'Business Career Innovation', 'Reliability And Quality Play A Lead Role In Your Business\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(3, , 'Admin ', '2019-09-29', 'Tech', 'During my visit to Delhi in October this year I took a cab from Gurgaon to Connaught Place, I was rushing as I was late for my meeting, Cab driver Dheeraj was listening to my conversation related to our new e-commerce portal, As I finished my call he asked me Sir why dont you try building AI to reduce turn around time with data that you will collect from every user, this will help your user to be engaged with your Portal for longer duration. I asked him about his background, as he replied I am a Btech. graduate who worked with startup as a growth hacker, I left my job and started 2 small QSR joints in Delhi and 2 Cabs in Uber, I am current building a Chatbot for HR based solutions, I drive the cab from 7:00 am to 4:00 pm and after that I work on my project as I am a LISP Coder myself.\r\n\r\nWe elaborated the conversation over the solution that he provided to me on our new E-comm. portal and Connected him with two investors of Mumbai in my circle.\r\n\r\nToday In the morning I received an Email from him stating that he get the angel investment from one of them and want me to be a part of his Startup as a sleeping partner.\r\nHence, World is full of opportunities and Collaboration is the key that can serve all the opportunities on your dinner table.\r\n\r\nCourtesy: Manav Sarin', 0, 0, '\r\nBusiness Career Funding Innovations Leadership Positive Thoughts Product Ideas Professionals Start', 'World Is Full Of Opportunities And Collaboration Is The Key That Can Serve All The Opportunities On Your Dinner Table\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(4, , 'Admin ', '2019-09-29', 'Tech', 'Last year, I refused a JOB offer.\r\n\r\nThe job was excellent with my DREAM profile.\r\n\r\nBut the role required relocating to a different country.\r\n\r\nIt was also a highly responsible position where I had to lead a team.\r\n\r\nI also realised that I will not be able to visit my home for at least a year\r\n\r\nI DECLINED the offer as I felt I will be losing:\r\n\r\nFamily\r\nFriends\r\nFood\r\nCulture\r\n\r\nI realised that without them I will not be able to focus on work.\r\n\r\nWhatever success I have in life is because of their support.\r\n\r\nNo amount of money/perks will be able to keep me happy.\r\n\r\nCurrently, I am having a different profile altogether and liking it very much and trying to create opportunities and invite others to INDIA\r\n\r\nLesson: Never give up the important things in life for some temporary happiness.\r\n\r\nIn the short term, it may seem you are giving up a big opportunity but in the long run, you will realise that it was a MISTAKE.\r\n\r\n', 0, 0, '\r\nBusiness Career Leadership Professionals Startups Technology Work - Life Balance', '\r\nNever Give Up The Important Things In Life For Some Temporary Happiness\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(5, , 'Admin', '2019-09-29', 'Interviews', 'rishna Mohan Jha  A Digital Veteran And Three Times Intrapreneur Turns An Entrepreneur To Change The Rule Of Business He Played Along So Far\r\nIdeapreneur Reporter  How you connect your vision to PMs Startup India and Standup India? Did he motivate you to any extent? How you like him?\r\n\r\nKrishna Mohan Jha  I quite like our prime minister and it would not be an exaggeration to say that he is one of the most inspiring leader the world has today on all accounts. His relentless quest & untiring effort for upliftment of the country across class & creed is going to be an inspiration for generations to come.\r\n\r\nBoth the start-up and stand-up India are great initiatives and is going to prove to be a highly effective catalyst in already vibrant start-up eco-system in India.\r\n\r\nAll this has definitely played a role in breaking my inertia ?\r\n\r\nIdeapreneur Reporter- How you feel being an Ideapreneur and now turning your Idea in to an Entrepreneurship Journey?\r\n\r\nKrishna Mohan Jha  Look, I always feel an idea is of no value till it has been implemented or rather successfully implemented wherein it adds value across eco-system.\r\n\r\nIf you ask me right now, I can tell you ten ideas which have the potential to make a great business but potential itself is not enough, translating the potential is! And therefore, I am glad that I have at least made a beginning, carrying forward one of the ideas that I had. I will feel accomplished only when I have added value to the entire eco-system which includes clients, my people, investors, industry and finally myself so that is about it!\r\n\r\nIdeapreneur Reporter  Could you give us a peep on what next? What message you would like to give to other youngster?\r\n\r\nKrishna Mohan Jha  There are some developments that I cant share. All I can say is that we are looking at strengthening our capability to bring about strategies which work more precisely and to do that we are to make our process more empirical.\r\n\r\nThe answer for this lies in Data led approach to decisions, which includes whole lot of solutions  we are working in the area of both product and capability development. This is all I can tell you at this stage.\r\n\r\nIdeapreneur Reporter  Thank You Krishna. Ideapreneur Team wishes you a great and successful entrepreneurship journey. ', 0, 0, 'Interviews leadership startup', 'Krishna Mohan Jha  A Digital Veteran And Three Times Intrapreneur Turns An Entrepreneur To Change The Rule Of Business He Played Along So Far');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(6, , 'Admin ', '2019-09-29', 'Interviews', 'Just last week,We(My boss) interviewed a candidate with a high salary. Working with a reputed company, his resume was impressive. During the interview, I realised he is not really upto the mark. I got curious as to why he is getting such a high CTC for 2.5 yrs exp. When I probed, I was appalled at how industry has been artificially inflating the CTCs.\r\n\r\nThe candidate had shifted 2 companies in 11 months. In his first company, after his appraisals he got a package of 8 lacs/annum from his previous 5.5 lacs. Next he quit & joined second company for 11.5 lacs (45% hike!)\r\n\r\nFurther after 8 months for whatever reason, he starts looking out again. Now, he held an offer of 16 lacs already. I asked him Why are you still looking out? He told me he is looking for better opportunity. He wanted us to better the offer by giving him 17 lacs\r\n\r\nIf this happen means Indian Industry is not even mature to evaluate the candidate. They just give based on previous salary and good will of previous employer.', 0, 0, 'Business Career Interviews Leadership Professionals Startups Technology Work - Life Balance', '\r\nIf This Happen Means Indian Industry Is Not Even Mature To Evaluate The Right Candidate');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(8, , 'Admin ', '2019-09-29', 'Interviews', 'A brief Professional Introduction: Dharmendra Yadav, Aged 20 years in last December of 2016 is a young, dynamic professional and still a college graduate. Dharmendra is a young student who have developed a platform to connect professionals, business and job seekers.\r\nIdeapreneur Reporter  Welcome Mr. Dharmendra, Congratulations for your Professionals Intro portal www.professionalsintro.com and its fantastic services. Now may we proceed with your interview?\r\nDharmendra  Thank you for your wishes and complement. Yes Sure.\r\nIdeapreneur Reporter  How this idea come to your mind to start a portal like ProfessionalsIntro.Com?\r\nDharmendra  Actually this idea of creating a portal come in my mind about having a personal web page of my professional or academic career. Then I saw that students are struggling for jobs and many jobs are not coming on right portal because recruiters are charged highly for posting these jobs. All of sudden a name came in my mind my Professional Intro should be published so that anyone can know about me.\r\nIdeapreneur Reporter  Appreciative move. What did you do to start making it? What were huddle in your way?\r\nDharmendra  I simply booked and planned its minimum features at first release and created a rough design. I collaborated with Software Engineer and a Web Designer to make it reality. We have worked and launched in 2 month. Investment and doing marketing is the main huddle which is still on the way.\r\nIdeapreneur Reporter  What are features on the www.professionalsintro.com and what are upcoming features if you dont mind?\r\nDharmendra  There are many features like register and create your public website page, update your professional and educational details along with CV. Post Jobs in free and anyone can post it. Search jobs and Apply directly to recruiter email/website. Users Dashboard and Manage Profile.\r\nIn future we are coming for verified profile and private messaging as well as connect and grow your professionals connections.\r\nIdeapreneur Reporter  What is your future expansion plan for better services? How Job Seeker and Recruiter will get benefited?\r\nDharmendra  Our future expansion plan are to create a social network of professionals so that they can share their dream, jobs, business and skills as well as grow their skills for better opportunities.\r\nA Job seeker should register a good profile with all details and CV so that recruiter can search and find them. Recruiters are free to post as many jobs as they needed and share the url on any media. Business and Startups can also get benefits of it.\r\nIdeapreneur Reporter  You just said Businesses and Startups can also get benefitted from its services by creating web page and registering. How?\r\nDharmendra  A business can also register their page and create a good profile. It will be like their personal website and startup can get a good network and its all free on Professionals Intro.\r\nIdeapreneur Reporter  What are future plan for expansion? What message you would like to give to other youngster?\r\nDharmendra  We are global so anyone from any location can register and we will expand to provide personalized skills test and training so that they can grow skill set. For youngster I would say Dream Big, Learn how to and Grab it.\r\nIdeapreneur Reporter  Thank You Mr. Dharmendra and Good Luck for your startup www.professionalsintro.com\r\nDharmendra  Thanks for your wishes. Thanks to All.', 0, 0, 'Business Career Interviews Leadership Product Ideas Professionals Startups Success Story Technology', 'Interview With Dharmendra Yadav- Co Founder And COO ProfessionalsIntro.Com\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(9, , 'Admin ', '2019-09-29', 'Governance', 'The recent surgical strike on black money is truly a bold move. Not surprising, industry doyens, economists and even the IMF have given Prime Minister Narendra Modi the thumbs-up. Beyond the benefits that it will bring to India, whats interesting for me is that it provides great lessons on how to drive transformative change. These takeaways can be applied to any context and organisation, irrespective of whether you are in government, private sector, social sector, education or anywhere.\r\n\r\nPerception matters as much as impact\r\n\r\nOne of Modis election promises was to remove corruption from India. One estimate, in fact, says that wealth from corruption comprises a fifth of Indias GDP. Since coming to power, the government has taken series of steps which led to ?1 .25 lakh crore in black money coming out in open. Some of the steps taken so far include setting up of a SIT (special investigation team) to get back money stashed abroad by wealthy Indians, implementation of the Black Money and Imposition of Tax Act, 2015, renegotiation of tax treaties, Income Declaration Scheme etc.\r\n\r\nModi has made the experience of change very visceral for people  this exercise is not something they will forget.\r\n\r\nWhile these were great steps, none of them seemed to register in the minds of the common people  the masses that make up the bulk of the nation. Not surprisingly, earlier this year, Transparency Internationals Corruption Perception Index found that India on a scale of 100 was perceived as scoring 38 in corruption in 2015, the same as the previous year. Clearly, while the government has not been hit by scams, the people thought that its promises to bring back black money were not coming to fruition.\r\n\r\nHowever, this demonetisation scheme is a masterstroke for the government in terms of winning the perception game. With his financial surgical strike, Modi has positioned himself as someone who walks the talk.\r\n\r\nYes, citizens are enduring great inconvenience, but if you watch interviews with people on the street, you will see that most of them believe its a move in the right direction; a recent poll found that 82% of people were in favour of demonetisation. There seems to be a belief that this move will help to clean up the nation. Now what Modi has done is that he has made the experience of change very visceral for people. They are going through the pain but know that their sacrifice is for a good cause  this exercise is not something they will forget. Modi to them has become the messiah of black-money elimination. For them it does not matter how much black money will actually be obliterated but since they are experiencing it, feeling it, it will be etched in their mind.\r\n\r\nWhat leaders driving organisational change should learn is that together with real impact, its important to make sure an impact is felt in the mind as well. People shouldnt just know things have changed, they should feel it and believe it.\r\n\r\nKnow when NOT to get stakeholder buy-in\r\n\r\nIn a change effort, it is key that stakeholders buy into what is getting deployed to make sure they participate in the effort and support it. Without this there could be resistance which delays and even derails the process. However, there are instances when specific actions need to be taken and one has to go all alone. For reasons ranging from the need for confidentiality to the sensitive nature of a matter to security issues, these steps are taken because its the right thing to do for a larger objective. This is based on the leaders convictions and he or she makes the decision unilaterally or in consultation with close confidants.\r\n\r\nWhen trying to do something transformational be ready to put your neck on the line. You cant be in a comfort zone and drive change.\r\n\r\nThis is exactly what Narendra Modi did. His larger objective was to make a corruption-free India, which is something he has spoken about publicly often. However, in the matter of demonetisation, secrecy was necessary (only a handful of people knew about it) so that black money hoarders wouldnt have advance warning to launder their assets or get rid of them.\r\n\r\nThe learning for change leaders is that there could be instances in a transformation effort when a leader has to go it all alone without getting buy-in. This is sometimes required for the success of a larger mission.\r\n\r\nPeoples actions change when they know theyre being watched\r\n\r\nDuring a nine-year study at Western Electrics Hawthorne plant in the 1930s, researcher Elton Mayo found that employees productivity improved when they knew they were being observed. This was called Hawthorne Effect and has been replicated in other contexts as well. For example, in 2011, when researchers of Carnegie Mellon University sent weekly postcards to customers of an electric company, informing them that their consumption was being watched, it resulted in a reduction of electricity use by consumers. There were also allegations in the US media about the Obama administration applying this technique to keep surveillance on government employees.\r\n\r\nI believe something similar will happen here. After the demonetisation scheme, citizens will be aware of the heightened monitoring by tax authorities; this will change the behaviour of tax defaulters and the like who will be more likely to declare their money going forward. While the problem of black money may not be completely eliminated, there will be an improvement due to the change in many peoples behaviour.\r\n\r\nThe takeaway for those wanting to drive a change in behavior is to tell the subjects that they are under scrutiny.\r\n\r\nBe ready to take major risks\r\n\r\nWhen trying to do something transformational, be ready to put your neck in the line. You cant be in a comfort zone and drive change. This is what Narendra Modi has done. Taking a decision such as the current demonetisation is not easy  theres major disruption and it can backfire in a big way if normalcy is not restored soon. If the cash is not replenished soon, the common person might have to endure substantial hardship; matters might be even worse in villages where banking penetration is weak. Also, the trader community that deals mostly in cash might suffer huge losses and might turn on the BJP that it has traditionally supported. And then of course there are protests in the Opposition, which could impact the functioning of Parliament. But Narendra Modi is a fearless leader who is driven by conviction. He knew he has to weed out corruption for the greater good of the nation even if it means alienating a few supporters.\r\n\r\nThe takeaway for change leaders is that you have to be prepared to become unpopular while youre driving a transformation in the organisation. Ultimately, your actions actions need to be driven by the larger objective of the change effort.', 0, 0, 'Business Career Governance Leadership Startups ', 'Leadership Lessons From Shri Narendra Modi Surgical Strike On Black Money\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(10, , 'Admin ', '2019-09-29', 'Governance', 'Around 150 people died in the recent train accident near Kanpur. The passengers of Indore-Patna Express were in deep slumber, when some 14 coaches of the train were derailed, apparently due to a rail fracture. It is one of the worst rail accidents in recent times, almost equally in casualties as that of Gyaneshwari Express in which some 150 had died in 2010, when the train had been derailed by Maoists in West Bengal. The scale of deaths and injuries makes the current accident, one of the worst in the history of Indian Railways. Sadly, going by the things as they are, this accident wont certainly be the last major one in Indias transport sector.\r\n\r\nThe travesty is that after every such incident, a set of actions/reactions follow almost in an autonomous mode. The opposition will bay for blood, the experts will decry the state of railways, the media will highlight all the unfulfilled promises and commitments, and the rail minister will set up a committee to investigate, promising strictest action possible. As the days pass and the dust settles down, the accident will become a statistic, invoked only in times of similar accidents, largely as an illustration of how no lessons are ever learned.\r\n\r\n\r\nBut then running Indian Railways is by no means an easy task. Sample these stats; railways have a network of more than 64000 kms in length. It runs around 7000 commuter trains; 12000 long-distance trains and 6000 freight trains this network daily. Around 22 million passengers commute over the network each day. Given, the sheer scale and size of the network, an accident like this in a few years should not raise much eyebrows, after all even Six Sigma allows you a few faults in a million, doesnt it? But and outcry is justifiable and needed, because the faults in Indian Railways system can have ghastly repercussions. Imagine, it was a rail fracture in the Kanpur accident (a crack that is a few inches wide on the metal track) that killed so many and injured so many more. Faults on railways are always a killer. Thus, there is just no excuse for them.\r\n\r\nRealising the dire state of the railways, the minister Suresh Prabhu had proposed to invest ? 1,27,000 crore over 2015-19 in safety work, which includes track renewal. In addition to ?1,02,000 crore to be spent on the locomotives, coaches, etc. And such steps were not the first ones. The previous government had appointed a committee under Anil Kakodkar to enhance railway safety.\r\n\r\nYet, in spite of all the supposedinvestment in safety and all the great plans, the real problem lies in the very manner in which the railways is run. The way the organisation (for a want of a better term) is structured, it is doomed for disaster and going bust in the days to come. Indian Railways (IR) is right now like a patient that is afflicted with tuberculosis, the symptoms are all there. But if we only concentrate on the manifestation and ignore the ailment, the patient is going to eventually die. The prognosis for IR is similarly dour. And heres why:\r\n\r\n\r\nIR is living beyond its pockets  for every 100 bucks that it earns, the transporter is actually spending some 114 bucks. A deficit of straight 14%, thats crazy isnt it?\r\n\r\nAnd can you guess what the biggest reason for this business anomaly is, it is the bloody manpower. Dont get it? Sample this:\r\n\r\nIR employs around 1.3 million people. Wages & salaries accounted for around 24% (?35,565 crore) of the total expenditure of ?1,46,000 crore in 2014-15. This years budgeted wage bill of ?40,435 crore is almost 25% of the total budgeted expenditure of ?1,63,000 crore. Add to that, the massive and mammoth pension burden. According to estimates, retirement benefits will account for 27% of total expenses in 2016-17. IR currently pays pension to a whopping 14.3 lakh ex-employees, whereas the number of serving employees is now 13.25 lakh. Thus, our national transporter is paying salaries (retirement benefits) to more number of ex-employees than the one currently on rolls.\r\n\r\nAccording to some news reports, if salaries and allowances are viewed along with the growing pension bill, the whole package is going to be three-fourth of IRs working expenditure budget. While earnings grew typically at a rate of around 10-11% per year, the pension bill grew at 17-18% . This year pension is 34%of its budgeted working expenditure.\r\n\r\nSo the simple query is; with some 50% of earnings disappearing fast in salaries and pension (and around 70% will in the future), where does IR have the money to invest in infrastructure or maintain its current one?\r\n\r\n\r\nThe trouble also lies in the way the railways are structured. While, it is meant to function like a PSU (generate income and spend money on expenditure), it actually works like ministry, under the lordship of ministers and IAS babus. The result is that unlike say a SBI that can take business decisions, all the ones taken by IR are dictated by political needs or expediency. Hence, even though it is extremely uneconomical, the railways is unable to raise passenger fares. But since, it needs to generate revenue, it keep increasing the freight fares (to cross-subsidise the loss from passenger traffic). Due to the constant rise in freight rates, IR is losing out on freight traffic, result its freight revenues are also on the dip.\r\n\r\nCurrently, the fuel expenses account for 15% of total rail expenses, and the rolling stock for another 20%, leaving nothing but a deficit so as to say. This is the reason, why railways infrastructure spend is so low. Take the case of the Dedicated Freight Corridors (DFC), against a budgeted investment of ?7,500 crore for DFC projects in 2015-16, it ended the year with an investment of less than half at ? 3,500 crore. IR just doesnt have the money.\r\n\r\nAnd yet, even with the dire finances, every year the rail minister will announce a slew of new trains, new measures, and new additions. Thankfully from 2017, when the rail budget is done away with, all such cosmetic things will not be necessary anymore.\r\n\r\nNonetheless, given the current financial drain on railways, safety will always take a backseat. All those great ideas that come from the various committees will seldom be implemented. So, the signaling will not be hi-tech, the coaches certainly wont, the computerised-braking systems wouldnt be implemented, etc. It is due to factors like these that accidents like the recent Indore-Patna one are computerised-braking systems wouldnt be implemented, etc. It is due to factors like these that accidents like the recent Indore-Patna one are bound to be repeated at regular intervals.\r\n\r\n\r\nSo, in the coming years, as one boards the trains, saying prayers or promising a coconut to the lords above will be a much safer bet in security than banking on the work done by the railways. Strangely, almost everyone seems to be oblivious to this singular economic fact. Till the railways resolves its people issues (especially the retired ones), it will never be able to fully run like a professional transporter. Its ironical that because of the resolves its people issues (especially the retired ones), it will never be able to fully run like a professional transporter. Its ironical that because of the railways caring so much for its ex-employees, the lives of its current commuters are at an increased risk.\r\n\r\nThe fact is that the scenario can be improved. We have in front of us, the instance of General Motors that had similarly close to million people on its rolls, and was facing a massive resource crunch because of the pension payouts. GM over the years, cut the fluff, renegotiated the terms of settlement, and largely averted a disaster.\r\n\r\nBut then again, IR is not a company like GM that is run on principles of economics, its a magic wand used by every government to dole out favours and help politicians make money. Till that is the case, any Tom-Dick or Shankar will be able to predict the doomsday scenario for IR. You dont need any crystal ball gazing, it is there, right in the budget. Hope Suresh Prabhu has some other ideas on the crisis that looms ahead.', 0, 0, 'Governance Leadership', 'Indian Railway Latest Disaster And Analysis With Ideas To Improve\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(11, , 'Admin ', '2019-09-29', 'Business', 'Vanity Cask is a unique concept that looks to create an alternate and effective discovery, marketing & distribution channel for the Indian beauty industry.VanityCask is a fresh perspective on the Indian Beauty Industry.\r\n\r\nThe Indian beauty market is one of the largest with a potential of Rs. 30,000 crore with a CAGR of approximately 20%. Yet, the luxury segment of the Indian Beauty industry remains largely untapped. The consumer base is of the Indian Beauty market is that of the mass consumption that usually looks for anything that might suit their budget/ economically.\r\nVanity Cask is a fresh perspective on the Indian Beauty Industry. This company was launched in August 2016 by Mr. Tarun Joshi who has been in the retail and marketing industry for over 30 years. He was the founding Managing Director of Brand house Retails Limited. In five years, Tarun led the company from inception to pan India growth. He leveraged the companys retail infrastructure to launch international luxury brands like Dunhill and Escada in India. He has been associated with some distinguished brands like Gillette, Belmonte, Reid and Taylor, etc. to name a few. He is the vision behind Vanity Cask and its founder. \r\nThe aim of Vanity Cask is to revolutionize the way people in India show and discover luxury beauty products. The accessibility to global lux brands by the discerning Indian customer, who has the dual advantage of sampling brands, as well as being given the cost benefit, will surely guarantee a sustainable business model. Thus,the Indian market has a tremendous potential to grow, especially in the luxury segment. Vanity Cask has ventured into the market with a specific aim in mind. They wanted to broaden the horizons of the Indian Luxury beauty segment and they are providers of premium luxury beauty products. Unlike their competitors, Vanity Cask has chosen to focus only on beauty products and is category specific. They focus only on Skin, Hair and Bath & Body segments.\r\nVanity Cask is a monthly box sample subscription where in the consumers are provided with a box at their doorstep which contains 5 products from either the Skin, Hair or Bath and Beauty segments. All these products are internationally known brands that define luxury in the beauty market. The company so far has launched 4 boxes, Skin and Hair care.  All the products that a part of the box are not only internationally recognized but also carefully chosen by a team of dermatologists and other experts in the beauty industry. The Company has made sure that all their products are segment neutral and that will suit all skin, hair or body types.\r\nThe company has tie ups with high quality investors that not only bring in capital but also experience in the Indian market. Vanity Cask as a concept and as a company is young and has a great potential in the Indian market. It has seen an over whelming response from the customers and beauty is an aspirational category and a young emerging India will consume premium and luxury brands at a much faster rate than ever before in the coming years.\r\nThe market response for the box and the concept has been phenomenal. They have managed to deliver across the country. While Metros continue to provide a lot of consumers, what really encouraged them was to see a quality response from Tier 3 & Tier 4 towns as well and in remote parts of the country.\r\nVanity Cask wishes to become the biggest discovery platform for premium luxury products in India. They are therefore, looking at aggressively expanding their subscriber base. The company has managed to reach over 2 million women across India through continuous advertising and leading beauty bloggers. They plan on upgrading their product and fiercely market the brand in India.', 0, 0, 'Business', 'How VanityCask is bringing a change in Indian luxury beauty product market and VanityCask Has Touched About 2M Lives of Women Across India.\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(30, , 'Admin ', '2019-10-01', 'Tech', 'Ive been a recruiter for the past several years. I have recruited people in several countries. Consistently and repeatedly, I see people with the following qualities succeed.\r\n\r\n1. People who blend in with a new culture, who are comfortable with change, people who reduce differences.\r\n\r\n2. People who understand the why behind business demands. Who think in terms of the larger picture. People who see themselves as a part of the process and are able to overlook small personal inconveniences.\r\n\r\n3. People who make a conscious effort to communicate and connect.\r\n\r\n4. People who have a solution finding mindset.\r\n\r\n5. People who smile often.\r\n\r\n6. People who understand the importance of what they do, and dont take it lightly or belittle it.\r\n\r\n7. People who are willing to show their vulnerability, who are willing to accept mistakes, who are willing to seek help.\r\n\r\n8. People who are respectful towards everyone, irrespective of position or hierarchy.\r\n\r\n9. People who make an effort to present themselves and their work well.\r\n\r\n10. People who value preparation and take time to prepare in advance.\r\n\r\n11. People who are able to respond objectively to criticism.\r\n\r\nThe good thing is, all the above can be acquired with conscientious practice and repetition.\r\n\r\n', 0, 0, 'Career Leadership Professionals Startups', 'People With The Following Qualities Succeed In Life And Career\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(31, , 'Admin ', '0000-00-00', 'Stories', 'Success Story: www.professionalsintro.com (Professionals Intro) is a great platform to connect Business, Skills, and Jobs to develop a dream career.\r\nYou can create your professional profile easily by registering and then go to manage profile and create your full virtual and professionals CV.\r\nHR Managers and Employers can freely post jobs as well as any professional who have knowledge about any opening can post it freely. Candidate can directly apply on employers email or website.\r\nProfessionals Intro will be a future jobs and business networking portal with key feature like connecting directly with business and starting many startups. I will be a virtual public profile or a personal website page for every professional.\r\nOn Professionals Intro every professional can create a CV and post resume there. They can create a full profile so that recruiters can see and get connected. In future you can connect with each other and send private messages. Every professional can own a verified profile after verified from office of Professionals Intro which will be a paid and subscription based service on it.\r\nIts now writing a landmark success story and soon it will be a platform for social recruitment which will attract more and more recruiters and professionals to create profile and get jobs.\r\nProfessionals Intro is very informative and supporting platform for jobs. Soon Professionals Intro will start personal development programs and Skills Rating Interview for your skills.', 0, 0, 'Product Ideas Startups Success Story Technology ', 'Success Story: Www.Professionalsintro.Com (Professionals Intro) Is A Great Platform To Connect Business, Skills, And Jobs To Develop A Dream Career.\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(32, , 'Admin ', '2019-10-01', 'Stories', 'Happiness is an achievable goal for everyone.\r\n\r\nGet started today on your happiness journey by beginning these habits of extremely happy people.\r\n\r\nThey are drawn to those things that are important to them.\r\nThey have nice, positive things to say about others and do not gossip.\r\nThey are respectful to themselves and everyone else in their lives.\r\nThey are not concerned about what others think of them.\r\nThey dont rehash the bad things that have happened to them.\r\nThey know that another person wont increase their happiness.\r\nThey understand that they are not perfect and dont try to be.\r\nThey believe in themselves.\r\nTheir best friends are happy people too.\r\nThey tend to watch a lot less TV than their peers.\r\nThey are honest and trustworthy.\r\nThey smile and laugh a lot.\r\nThey dont settle for mediocre.\r\nThey live in the moment.\r\nThey donate their time, energy, and money selflessly.\r\nThey focus on things they can control.\r\nThey are gratefulfor the things they have.\r\nThey are the ultimate optimists.\r\nThey take care of their needs first because they know this will benefit others.\r\nThey appreciate who they are even with their shortcomings.\r\nThey flourish in maintainingmeaningful personal relationships.\r\nThey maintain a well-balanced life.\r\nThey put more value on experiences than on material possessions and understand that money cant buy them happiness.\r\nTheyfollow their heart.\r\nThey take solace in the fact that every rejection will befollowed by something wonderful.\r\nThey dont make an effort nor need to be liked by others.\r\nThey are very good at releasing things that no longer help or serve them.\r\nThey dont waste time comparing themselves with others.\r\nThey have well-developed ways of coping when things get rough.\r\nThey are very forgivingand resilient.\r\nThey are typically healthy peoplethey exercise and think about what goes in their bodies.\r\nThey take in the beauty of all that surrounds them.\r\nThey focus and go after their goals with fearless optimism.\r\nThey try different routines to change things up.\r\nThey dont waste their time proving someone else is wrong.\r\nThey take the time to do things for themselves.\r\nThey see a misfortune as an opportunity to grow and change.\r\nThey dont wait for happiness to land in their lapsthey pursue it.\r\nAnd, even when they have a moment of sadness, they know that happiness is just around the corner.', 0, 0, 'Business Career Leadership Positive Thoughts Startups Success Story Work - Life Balance ', 'Happiness Is An Achievable Goal For Everyone\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(33, , 'Admin ', '2019-10-01', 'Stories', 'Miss Tina Dabi, a 22 years old girl who is topper of Union Public Service Commission exam 2015-16 Batch has set an example to all youth. Everybody has surprised that being a woman, she just cleared this exam in her first attempt. She was so prepared for it from very first day of schooling, she made foundation from her school and cracked once got opportunity. We are sure that if there would not be a minimum age limit of 21 years so could do it even before.\r\n\r\nHer success story motivate to every Indian women and empower them to do differently. Lets put some light on lessons we can learn from her.\r\n\r\nClarity & Focus: She had clarity of her career from very first day of her schooling. She had amazing focus on the target to only become an IAS. Everyone should learn that clarity and focus are key to success. You can not succeed until you are not clear what you want to become. You focus should be from day one when you are clear what you want to do. Many Ideapreneur, Aspirant and Entrepreneur can learn this skill from her.\r\n\r\nHard Work & Dedication: There is no substitute to hard work in the life. You have to work hard to get success in the area you want to grow. Your dedication will decide how you are going to succeed. You must do your preparation with full dedication toward your goal in career.\r\n\r\nPatience: As Miss Tina said that patience is key to success and there will time come when you will get upset and depressed. Your patience will be deciding factor for your success. You need to keep patience and trust in your capability.\r\n\r\nTime Management: The main thing a participant or aspirant learn that time management. We know that many young guys think to do what they dream for but they fail due to lack of time management. They just started randomly and doing many thing. She had cleared in one go means she had managed her time on task which were more important to success.\r\n\r\nFamily & Friends Support: You are part of society and need your family support to deal with many obstacle. You family experience can lead you many lessons. If you do not have family to support you on progressive ground then take advise of your friends but your mentors should be well established.\r\n\r\nGovernance for Women Empowerment: Her keen interest to work for gender inequality show that she will do a better for women and good governance. She want to make an social impact on society through her service. You can learn the social cause from her.\r\n\r\nWe congratulate Miss Tina Dabi for her success and wish her all the best for great career.', 0, 0, 'Governance Success Story ', 'Lessons You Can Learn From Miss Tina Dabi, IAS Topper 2016 At Age Of Just 22.\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(34, , 'Admin ', '0000-00-00', 'Business', 'Mumbai-based start-up Yumlane  a brand for food products  has secured $ 1 million in a seed round of funding led by Flipkarts CEO Binny Bansal. Anupam Mittal  founder of People Group, Harish Bahl of Katalyzers fund, Sachin Bhatia  co-founder of MakeMyTrip and Darius Pandole  partner at private equity firm New Silk Route were among others who were involved in the round.\r\n\r\nHitesh Ahuja, the former vice president of New Silk Route  an Asia-focused private equity fund, founded Yumlane which is ran by Qwikpik Technology Pvt. Ltd. The team includes Rueben Ghosh co-founder (Product), Rahul Kumar co-founder (Technology) and Anirudh Mantri Vice President (Operations).\r\n\r\n Yumlane works with vendors, who prepare the food that is then sold under the brand name. It offers hot snacks and meals that range between Rs 50  80 and are currently available across 10 different retail stores across Mumbai. This number will advance to 50 by the end of this month, with the platform aiming to reach out to up to 1000 retail stores by the end of this financial year. Consumers can pre-order and it also has an option to pay online and collect their food from the nearest store.\r\n\r\n Yumlane oversees the quality control, the supply chain, retail, marketing and distribution for the products. They will also expand their product portfolio through a process which will see new products being rolled out in Mumbai in a span of 6 to 9 months. Moreover, the company will possibly launch an app for regular customers.\r\n\r\n When asked about his new start-up, Hitesh Ahuja said, We would like to make great food accessible to everyone, everywhere and leverage the deeply fragmented retail landscape our country offers. The raised funds will be used for marketing and brand building. He further added that the platform plans to work with the retail outlets as they are more convenient for the consumers.\r\n\r\n Binny Bansal and Sachin Bansal have been active investors and have invested over $ 1 million in start-ups like MadRat (an offline gaming company) and Ather Energy (an automotive start-up) in the year 2014. This year, though there has been a battle between companies to raise funds from investors, the number of funding deals for early-stage start-ups has escalated. Indian start-ups raised $1.42 billion across 307 deals in Q1 2016, according to YourStory Research. During the same period, there were 132 early-stage deals, out of which 112 were Pre-Series A deals.', 0, 0, 'Business', 'Food start-up Yumlane augments $ 1 million seed fund from Binny Bansal and others.\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(35, , 'Admin ', '0000-00-00', 'Innovation', 'In the jungle which animal is the biggest .\r\nI heard you say, Elephant.\r\nIn the jungle which animal is the tallest .\r\nI heard you say, Giraffe.\r\nIn the jungle which animal is the wisest\r\nI heard you say, Fox.\r\nIn the jungle which animal is the fastest .\r\nI heard you say, Cheetah\r\nAmong all these wonderful qualities mentioned, where is the Lion in the picture?\r\nYet, you say the Lion is the KING of the jungle even without ANY of these qualities.\r\nWhy?\r\nBecause\r\nThe Lion is courageous, is very bold,\r\nHe is always ready to face any challenges, any barrier that crosses his part, no matter how big they are.\r\nA Lion walks with confidence. The Lion dares anything and is never afraid. The Lion believes he is unstoppable. The Lion is a risk taker. The Lion believes any animal is food for him. The Lion believes any opportunity is worth giving a try and never allows it slip from his hands. The Lion has charisma.\r\nSo What is it that we get to learn from the Lion .\r\nYou dont need to be the fastest or the wisest or the smartest or the most brilliant or to be generally accepted to become your dreams and be great in life.\r\nAll you need is courage, boldness, the will to try, the faith to believe it is possible, to believe in yourself that you can do it.\r\nIts TIME to bring out your Lion in you.\r\n\r\n', 0, 0, 'Business Career Innovations Leadership Positive Thoughts Startups Work - Life Balance', 'The Lion Is Courageous, Is Very Bold. Its TIME To Bring Out Your Lion In You. Be The King\r\n'),
(36, , 'Admin ', '2019-10-01', 'Innovation', 'Activities that show you more productive but actually not.. lets see what are those:\r\n\r\n1. Thinking to make a To-Do list and defining formats for that. Instead just start writing down whatever comes in mind\r\n\r\n2. Writing the most important and heavy task as top priority which involves lot of dependancy. That will kill lots of our time & easy tasks will stay for long time in queue. If a task can take just half an hour to do, lets do it instead planning\r\n\r\n3. Long Meetings with no preparation which ends with no plan of action and ownership. Better to have a strict agenda and not deviate from it. (Many a times I have done this in the past hence a lesson am sharing)\r\n\r\n4. Agreement to do all tasks or owning all responsibilities. This might surely show productive but we cant even start one at a time as a thought of too many will stagnate us\r\n\r\n5. Thinking us a multitasker. All tasks will be half cooked and none will be completed. Better multi task within one task and complete one.\r\n\r\nHope this helps. A small tip, better to write down all simple tasks first so we complete few soon and focus the big with dedicated hours of investment.\r\n\r\n', 0, 0, 'Business Innovations Leadership Positive Thoughts Professionals Startups Work - Life Balance ', 'It Looks You Are More Productive By This But Really You Are Not More Productive\r\n');
INSERT INTO `main` (`Id`, `Images`, `Author`, `Timestamp`, `Category`, `Content`, `Upvote`, `Downvote`, `Tags`, `Heading`) VALUES
(37, , 'Admin ', '2019-10-01', 'Women', 'Indian food habits are way far different than other countries. We Indians have a lot of spicy and oily food. Such foods are present in every occasion and are liked by ever one. But this food leads to health issue like obesity.Indians enjoy a very sedentary lifestyle; to get them to an active lifestyle is quite a task. It includes a combination of changing their eating habits and getting them to exercise, more so in children who are often found with high levels of obesity simply because they are just not physically active, says Co-Founder and Managing Director of AktivOrtho Gabrielle Seacy.\r\n\r\nGabrielle is an Irish lady and a commerce graduate from university college cork. She has over 15 years of international marketing and business management experience in Ireland, the UK, Asia-Pacific, and Nordic Benelux. She has also worked in textile industry and is a IT person who has done stints at London and Paris. She has excelled in all possible flied.\r\n\r\nGabrielle says her service as people service and here is what AktivOrtho does as people service-\r\n\r\nit helps improve your quality of life. It is a European model of rehabilitation chain of clinics focusing on orthopaedic, gynaecological and neurological rehabilitation, prevention and sports medicine. The fact that sports medicine has also grown as a niche sector has worked to the advantage of AktivOrtho.\r\n\r\nBe it a six-month-old child to people well into their 80s, AktivOrtho offers treatment across all age groups.\r\n\r\nShe started up in because of an insistence of an Indian who was treated by them in Hamburg clinic in Germany. He was immensely benefitted and wanted others in his home country to be similarly helped, and that is why he asked us to start our chain of clinics here in India, adds Gabrielle. She operates the clinic with her husband Dr.Gerd Mueller. As the request started increasing they both started making visits to India to know about the business opportunity. And in April 2012, they opened their first centre in Delhi. Currently, there are four clinics in Gurgaon and seven in Germany.\r\n\r\nGabrielle is very happy about her people service and she thinks that she is making a difference in people who walk into their clinic. She is also mother of two young kids who are just 10 and 8. But with the support at home she manages to excel in her service.\r\n\r\nGaberielle got all her motivation from her husband. Being married to him, I could see huge benefits people got from his line of treatment. It was hugely rewarding. To see people enjoy long and healthy life is also a motivation for us to keep growing, says Gabrielle.\r\n\r\nGabrielle share with us how a Oman man who had multiple surgeries in ankle and had to walk with crutches got cured in a six week therapy at AktivOrtho. She says The ideal thing to do is go for brisk walks every day in the mornings. It exposes people to the sunlight, a direct source of Vitamin D.\r\n\r\nGabrielle is happy that their children are able to perceive various Indian cultures. She and her husband handle the business really well. She handles finance, marketing and client servicing.\r\n\r\nWhile on the other hand her husband handles treatments. We both are a very strong team with a huge amount of trust between us. We bring very different skill sets and I can proudly say the success of our business is partly because of the fact that we work together as a team, signs off Gabrielle.', 0, 0, 'Women Business', 'IRISH LADYS PEOPLE SERVICE IN INDIA\r\n'),
(38, , 'Admin ', '0000-00-00', 'Women', 'Women are taking up all the professions possible. Now in almost every flied you can see a women working. They are setting trends by coming up with innovative start-ups of their own. PrachiGarg in her book has SUPERWOMAN has listed about such women.\r\n\r\nPrachi Garg is writer as well as entrepreneur of ghoomophiro.com- A company for corporate tours and Anmoluphar- Gifts based on currencies.She graduated from Miranda House and Great Lakes Institute of Management, with a background in computer science.\r\nMadhavi Gandhi started happy hands organization which aims about empowering rural artisans and preserving the traditional handicrafts and art forms. She was evident since age of 22 as art loving person. Her family and well-wishers support her a lot. She conducts capacity building workshops for the artisans. Her vision is that every child of the artisans should feel proud about their parents work and find pride in livelihood of Indian culture\r\nRia Sharma founded an NGO for acid attack victims called Make Love Not Scars. She has studied fashion in UK but still finds peace in social activities. Her NGO has helped many acid victims with medical, financial, social and legal aid. She says that she thought she is the one who is going to help them but it is them who has helped her by bringing the emotional upiftment.\r\nRicha Singh is the founder of your dost website where counselling is given online for people suffering from depression. She suffered from depression to when her friend committed suicide. She came out of it and realized that there are many people like her. She also realized the fact that people in India are not very open about to such psychological problems. With the help of her peer group she launched this online website. This site receives fund from Milaap.\r\nAlicia Souza is an independent illustrator and communications designer, with clients such as Google, Yahoo, Penguin, Cadbury and AOL. She spend most of her growing ages in Middle East. She draws inspiration from everything that surrounds her. Her parents were first not so ok with this kind of work but things worked out well and they now know that she is right.\r\nSunita Jaju and Swati Maheshwari are founders of Rustic art a eco-friendly body care product. They are from Ninital and Mysore respectively. Their passion towards environment brought them together to start such a venture\r\nSneha Raisoni started TappukiDukan in fort area of Mumbai. Here you would find the most beautiful unique Indian Products. She sells products which have utility but with a twist. She sources them from Happily Unmarried, Pop Goes Art and other creative firms.\r\nRicha Kar founded ZIVAMBE the online lingerie website to improve the experience of purchasing lingerie for a Indian women. She is from an engineering and business background. Her experience, insights and oppurtunities helped her reach here. She wants to eradicate the misconceptions and taboos in India about lingerie shopping through E-commerce website. Educational content, Discreet packing abd fitting lounge of Zivambe are some the innovations by them in these space\r\nMasoom Minawala is the founder of StyleFiesta an online fashion website. She studied fashion in London and Launched her start up in 2012. Women are blessed with an undeniable charm and it would be foolish not make use of it, she jokes, describing the blend of creativity and commerce in her work.\r\nAnisha Singh founded an online discount site called Mydala.com after her earlier e-Learning ventures Kinis Solutions. She worked on Women Entrepreneurship during her US stint. First the office space was shared with adentist and now there are around 400 People working under her.\r\nCharnita Arora launched Perfect Life Spot to help with language skills and overall development of young students. It goes beyond rote-based learning to offer mindfulness and emotional intelligence support. The company is now offering skills to corporate audiences as well.\r\nFalak Randerian launched MyChatterBox for improving Children reading habit and also the leading Library My Reading Room. Her passion towards reading and her love towards children gave her this idea.\r\nPankhuri Shrivastava founded Grabhouse as an online platform for landlords and tenants. She founder are Venture at the Age of 23. The basic listing is free but other services are charged. Basic things like outsourcing to a third party can make you lose control of things, she says, as words of advice.\r\nSaumya Vardhanlaunched an online website SubhPuja for religious and astronomical consultancy services. She saw her friends family suffering a lot with the rituals after her friends death. So she decided that to make this rituals a more transparent to avoid misconceptions and mal practices. She studied Vedic Astrology and brought many expert pundits together for online consultation.\r\nVidulaKantikar Kothare founded ThinkCreative Ad Solutions as an end-to-end provider of marketing, advertising, branding and event management. She learns as much as possible. She believes that power of woman lies in her multi- tasking abilities.\r\nTina Garg is the founder of PinkLemonade communication agency. She had to work hard to establish her has a women in these flied mostly filled with men. Her firm sustains a creative and cool culture via initiatives like Fun Fridays and Pink Holiday monthly draws for a free holiday for an employee.\r\nDr Surbhi Mahajan founded Dermatocare to offer online consultation on skin care and cosmetic products. She began with a blog, whose popularity led to forming a full-fledged venture in 2012. She sees her work as going beyond short-term solutions for glamour.\r\nOther entrepreneurs profiled in the book are Rachana Nagranee(founder of Pitaara, for handcrafted bags and accessories), Geetika Chadha (founder of image consultancy Imagenie), Rashi Narang (founder of pets merchandise store Heads up or Tails) and Sneh Sharma (founder of the only-girls digital media agency Ittisa). It would have been great if the book also offered tips and advice in a concluding chapter, which would have been useful for other aspiring entrepreneurs.\r\n', 0, 0, 'Women Business', 'INNOVATIVE START-UPS BY WOMEN\r\n');

